import React from 'react';
import Card from './card.js';
// this constructor CardList becomes parent of Card constructor
//jsx item card imported can be deconstructed and the id, name, etc., passed
// robots deconstructed and passed as props to CardList

const CardList = ({ robots }) => {
	return (
		<div>
			<Card
				id={robots[0].id}
				name={robots[0].name}
				favefood={robots[0].favefood}
				description={robots[0].description}
			/>

			<Card
				id={robots[1].id}
				name={robots[1].name}
				favefood={robots[1].favefood}
				description={robots[1].description}
			/>

			<Card
				id={robots[2].id}
				name={robots[2].name}
				favefood={robots[2].favefood}
				description={robots[2].description}
			/>
			<Card
				id={robots[3].id}
				name={robots[3].name}
				favefood={robots[3].favefood}
				description={robots[3].description}
			/>
		</div>
	);
};
export default CardList;
